    "Why has CONUN developed its own private blockchain network? ":
      "Why has CONUN developed its own private blockchain network? ",
    "With our business diagram, you can easily understand the projects at CONUN. The DSC platform, our main business, provides high-performance computing created by sharing idle resources from users' PCs or smartphones through a P2P network. Whoever wants to complete tasks requiring high-performance computing can upload them, then the CONUN Drive stores them. However, more than simple storage, the CONUN Drive aims to become a market where you can share and purchase digital assets. A cryptocurrency wallet, METACON, processes any transactions for rewards and payments in any CONUN's services like the DSC platform. It also provides a swapping service for users who want to exchange CONX to CON. (You can buy CON on Bithumb and BW.) All these services are running through the CONUN Private Blockchain Network, and you can check any information updated live on CONSCAN, CONUN’s blockchain explorer.":
      "아래는 코넌이 진행하고 있는 프로젝트들을 한 눈에 볼 수 있는 사업구성도입니다. 주요 사업인 DSC 플랫폼은 P2P 네트워크를 통해 연결된 사용자의 PC 또는 스마트폰으로부터 유휴 자원을 공유 받아 고성능 컴퓨팅을 구현해냅니다. 사용자가 고성능 컴퓨팅을 통해 처리하고 싶은 프로젝트를 업로드하면, 코넌 드라이브가 이를 저장하는 스토리지 역할을 수행합니다. 하지만 코넌 드라이브는 단순한 스토리지 역할을 넘어, 디지털 자산인 NFT을 공유하고 거래하는 마켓을 궁극적인 목표로 하고 있습니다. DSC 플랫폼이나 코넌 드라이브 이용 중, 발생하는 리워딩 또는 결제는 코넌의 암호화폐 지갑인 메타콘/코넌 매니저를 통해 이뤄집니다. 또한 사용자는 리워드로 받은 CONX를 메타콘을 통해 이더리움 네트워크에 CON으로 교환할 수 있습니다. (CON 구매는 빗썸과 BW에서 가능합니다.) 이런 코넌의 모든 서비스는 코넌 메인넷을 기반으로 실행되고 있으며, 코넌 블록체인 익스플로러인 콘스캔을 통해 실시간으로 업데이트되는 블록 및 거래 정보를 확인하실 수 있습니다.",
